ただ、るしあちゃんのヤンデレムーブは配信視聴者の多くが望んでいることのように思うので、イジれる空気感の際にはスパチャしなくともチャット欄は弄り一色になるので、割とすぐヤンデレムーブは見れると思いますw
切り抜きとしては長すぎたり、その場の流れがないと楽しめないために切り抜かれていないヤンデレポイント等も数多くあるので、是非配信も見てみてください！

